import React from 'react';
import isEqual from 'lodash/isEqual';

import { action } from '@storybook/addon-actions';
import { object } from '@storybook/addon-knobs';

import Form from '../src/UIForm-v2/FormSwitcher';

const DEFAULT_DATA = { jsonSchema: {}, uiSchema: [], properties: {} };

const actions = [
	{
		title: 'Reset',
		type: 'reset',
		widget: 'button',
	},
	{
		bsStyle: 'primary',
		'data-feature': 'form.feature',
		title: 'Submit',
		type: 'submit',
		widget: 'button',
	},
];

function story() {
	const data = object('data', DEFAULT_DATA);

	if (!data || !data.jsonSchema || isEqual(data, DEFAULT_DATA)) {
		return (
			<div className="panel panel-info">
				<div className="panel panel-heading">Test UIForm</div>
				<div className="panel panel-body">
					<figure style={{ display: 'table', width: '50vw' }}>
						<img
							src={
								'data:image/png;base64,'
							}
							alt={''}
							width={'100%'}
						/>
						<figcaption
							style={{ display: 'table-caption', captionSide: 'top', paddingBottom: '1rem' }}
						>
							Paste JSON in <span className="label label-default">KNOBS</span> tab below ðŸ‘‡
						</figcaption>
					</figure>
				</div>
			</div>
		);
	}

	return (
		<Form
			actions={actions}
			data={data}
			onReset={action('onReset')}
			onSubmit={action('onSubmit')}
			onTrigger={action('onTrigger')}
		/>
	);
}

export default {
	name: 'Form tester',
	story,
};
